script: |
  super -f text -I q8414.spq | sort > q8414.out

inputs:
  - name: q8414.spq
    data: |
      SELECT 5 AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE NOT 44 IN ( + CAST ( - col1 AS INTEGER ), col1 + - - col2 + - col1 );
  - name: tab1

outputs:
  - name: q8414.out
    data: |
      5
      5
      5
